import style from '../components/creatcomponents/creatcomponents.module.css';
import CreatBodySurv from '../components/creatcomponents/Creatbodysurv.';
import CreatMainTitle from '../components/creatcomponents/CreatMainTitle';
import CreatMainContent from '../components/creatcomponents/CreatMainContent.';
import CreatIntroduce from '../components/creatcomponents/CreatIntroduce.';
import CreatComent from '../components/creatcomponents/CreatComent';
import Header from "../components/Header";
import Survebar from "../components/Survebar";

function  CreatLayout() {

    return(
            <div className={ style.container}>
            <Survebar/>
            <Header/>
                <div className={ style.postbodystyle }>
                    <CreatBodySurv/>
                    <CreatMainTitle/>
                    <CreatMainContent/>
                    <CreatIntroduce/>
                    <CreatComent/>
                </div>
            </div>
    )
}

export default CreatLayout;
